import React from 'react';
import EquipementGare from './EquipementGare'

class Gare extends React.Component {
    render() {
        this.props.data.map((element) => {
            console.log(element.data())

            return (
                <EquipementGare data={element.data} />

            )
        })
    }
}
export default Gare
